description:
A Hallmark original movie about a woman who is surrounded by weddings for everyone but herself until one day she meets not one, but two possible matches and is forced to choose between her head and her heart.

Laurel Haverford runs a floral shop with her meddling grandmother, Rose, and is always planning weddings for everyone but herself.

Soon, all of her friends are getting married, leaving her behind, and she begins to wonder if she will ever find Mr. Right.

Suddenly, Laurel meets a doctor who knows about flowers, loves to cook and appears to be everything a girl could want...
